export class Persona {
  constructor(id, fullName, position, ubication, url) {
    this.id = id;
    this.fullName = fullName;
    this.position = position;
    this.ubication = ubication;
    this.url = url;
  }

  get getId() {
    return this.id;
  }

  get getFullName() {
    return this.fullName;
  }

  get getPosition() {
    return this.position;
  }

  get getUbication() {
    return this.ubication;
  }

  get getUrl() {
    return this.url;
  }

}
